import './App.css';
import Header from './components/Header/Header';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Header></Header>
      <Routes>
          <Route path="/" element={<p>Welcome to my React app!</p>} />
          <Route path="/login" element={<Login />} />
        </Routes>
    </div>
  );
}

export default App;
